import Header from "../components/Header";
import Footer from "../components/Footer";
import Snk from "../components/Snk";
import ListTv from "../components/ListTv";

const TvProgram = () => {
    return (
        <>
        <Header />
        <ListTv />
        <Snk />
        <Footer />
        </>
    )
}

export default TvProgram
